.abg {
    background: url("/static/img/97c518d.dot.png");
}/**
 * @provides main
 */

html {
    height: 100%;
}
body {
    height: 100%;
    width: 100%;
    font-family: "Microsoft YaHei";
    color: #000000;
}
header {
    width: 100%;
    height: 80px;
    background: url("/static/img/4985b30.finish.png") no-repeat center center;
}
p {
    width: 90%;
    padding-left: 5%;
    padding-right: 5%;
    margin-top: 1em;
    color: #666666;
    font-size: 1em;
    line-height: 1.5em;
    text-indent: 8px;
}
input {
    display: block;
    margin: 1em auto;
    width: 90%;
    height: 2em;
    border: solid 1px #333333;
    border-radius: 3px;

    font-size: 1em;
    line-height: normal;
    text-align: left;
    text-indent: 8px;
}
button {
    display: block;
    width: 60%;
    height: 2em;
    margin: 0 auto;
    font-size: 1em;
    line-height: normal;
    text-align: center;
}
div {
    width: 90%;
    margin: 1em auto;
    font-size: 1em;
    color: #666666;
    line-height: normal;
    text-align: left;
    text-indent: 8px;
}

